window.bookSummaryJSON = "<p>Dark. Gritty. Taboo.</p> <p><i>Lark</i>: Book One of the Dark Duet</p> <p>Broken-hearted and mortified after being dumped when she expected a proposal, Lark calls her best friend and roommate for a rescue. While waiting to be picked up, she ducks around the corner into the alley to gain her composure, unaware it will be the action that leads her into a trafficking syndicate.</p> <p>Kidnapped, along with her best friend, Lark wakes up to find herself in a cell with her friend, her ex, and her ex's partner. Forced to submit, or become casualties of circumstance, they stick together and comply—making the best they can out of a terrible situation.</p> <p>Stripped of all dignity and choice will Lark make it out alive? If she does, what will be left of her?</p> <p>This is a reverse harem, whychoose, and fast burn, extra dark, and extra spicy. Mature audiences only—possible TW include but are not limited to: Dub/Noncon, Drug Use, torture, branding, gore.</p> <p>This duet ends in an HEA.</p> <p>Audiobook is a duet narration.</p>"; 
